-- Create a new database called 'TeachSQL'
-- Connect to the 'master' database to run this snippet
USE master
-- Create the new database if it does not exist already
IF NOT EXISTS	(
    				SELECT name
    				FROM sys.databases
    				WHERE name = N'TeachSQL'
				)
				CREATE DATABASE [TeachSQL]
GO

USE [TeachSQL]
-- Create a new table called 'tblDHCPLog'
-- Drop the table if it already exists
IF  OBJECT_ID('tblDHCPLog', 'U') IS NOT NULL
    DROP TABLE [tblDHCPLog]
GO
-- Create the table
CREATE TABLE [tblDHCPLog] 
(
    LeaseID INT IDENTITY(1,1) PRIMARY KEY,
    IP varchar(20) not null,
    SRCMAC varchar(25) not null,
    LeaseTime INT NOT NULL,
    LeaseDate DATETIME NOT NULL
)
